import React from 'react';
import logo from './mlogo.png';
import './App.css';
import Header from './Style.jsx';

function App() {
  return (
    <div className="App">
      <Header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <h1>Marvel Encyclopedia</h1>
      </Header>
    </div>
  );
}

export default App;
